import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from "react-router-dom";
import {MainPage} from './pages/MainPage'
import {FilmPage} from "./pages/FilmPage"
function App() {
  return (
    <div className="App">
      <Router>        
       <MainPage/>  
         <Routes>
          <Route path='/film/:id' element={<FilmPage/>}></Route>
          <Route path='/' element={<MainPage/>}></Route>
        </Routes>      
      </Router>
    </div>
  );
}

export default App;
